import React from "react";
import "./Form.css";

function NewForm() {
  const userName = "Username";
  const age = "Age (years)";

  return (
    <div>
      <div className="formcontent">
        <h2>{userName}</h2>
        <input className="input" type="text" />
        <h2>{age}</h2>
        <input className="input" type="number" /><br />
        <button type="submit" className="formButton">
          Add user
        </button>
      </div>
    </div>
  );
}

export default NewForm;
